      out.write("\t\t\t\t\t\t\t<p>\r\n");
      out.write("                                读书使人充实，讨论使人机智，笔记使人准确，读史使人明智，读诗使人灵秀，数学使人周密，科学使人深刻，伦理使人庄重，逻辑修辞使人善辩。凡有所学，皆成性格。 —— 培根\r\n");
