      out.write("\t\t\t\t<div class=\"col-md-9\">\r\n");
      out.write("\t\t\t\t\t<blockquote>\r\n");
      out.write("\t\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t\t<font face=\"华文行楷\">读书，这个我们习以为常的平凡过程，实际上是人们心灵和上下古今一切民族的伟大智慧相结合的过程。</font>\r\n");
      out.write("\t\t\t\t\t\t</p> <small><cite>高尔基</cite></small>\r\n");
      out.write("\t\t\t\t\t</blockquote>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t知乎上阅读话题下的粉丝有500多万，也就是说大概每8-10个知乎用户里面就有一个关注了“阅读”。看起来很多了吧？\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t但“健身”、“美食”这类话题的关注人数差不多有“阅读”的1.5-2倍。虽然这种分析方式太过粗暴不够科学。但也可大体推测出：<strong>或许在大部分人心中，“吃的好”、“身材棒”要比“有知识”、“有思想”重要很多。</strong>\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t读书的快感远远比不上吃东西时的快感，读书带来的正向反馈也远不及健身那样明显。有可能花了5个月含着泪啃完了某大V推荐书单里的一本书之后，却发现什么东西都没记住。你疑惑满满的提了个问题：“读了很多书，但是都忘掉了，读书的意义在哪里？”然后取关了阅读话题。\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t那么那些相对于吃喝玩乐而言较少一部分热衷于阅读的人，他们在读书中收获的快感，或者说意义又在哪？\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t谈论意义本身并没有什么意义，还是换成“快感”或“成就感”比较直观可感一点：\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t你知道黎曼几何 拓扑学 混沌理论 Higgs波色子 量子纠缠 分子机器 神经网络算法 细胞自噬......是什么，别人不知道，快感＋1。\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t你知道mvp的含义不仅仅是“最有价值球员”，还有“最小化可行产品”，而且除了把他们运用在创业上外，你还把它用在生活中的方方面面。成就感＋1。\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t你熟练的运用“巴甫洛夫把妹法”，历时3月成功俘获了一只妹子。成就感＋1。\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t当你犹豫一件事该不该做时，忽然想到了“不值得定律”，然后斟酌了一下果断放弃。快感＋1。\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t当你和一个睿智的长者交流。你们聊西方那些国家的习俗和文化，聊世界50大名曲的谱曲和旋律，聊各种不同语言之间的异同之处，聊那个年代的电机，雪糕，汽车的发展史。all＋1。\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t<strong>一句正确的废话可能是：读书的一个重要意义，就是让那些读书的人感受到了读书的意义所在，感受到了它的好，然后继续阅读下去，反复从中受益。</strong>\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t很多答案里讲故事说读书怎样改变了身边人或自己的命运，但这只是读书带来的思想、行为上改变之后，自然而然的附加奖励。佛曰不可说，还是有些最底层的东西，很难用文字去表达和描绘。\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t<strong>读书兼具消遣，放松，学习，思考的功能，是快速了解这个世界，了解不同有价值思想，满足各种心理欲望的捷径。</strong>\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t就像童年时的《唐诗三百首》和《十万个为什么》，中学时代的《当悲伤逆流成河》、《校花大白腿》和《盗墓笔记》，大学时的《微积分》、《相对论》和各种文献，毕业之后的《金字塔原理》和《商务与经济统计》。<strong>每个人，每个人的不同人生阶段，都有不同的东西值得阅读。</strong>\r\n");
      out.write("\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t阅读的意义于我个人而言，是<strong>通过现有主要学科的一些重要著作来建立对这个复杂世界的一些系统性认识，从而更深入的了解宇宙，了解内心。</strong>\r\n");
